#define PP_CSUM_2(a1,a2) (2*a1+1*a2)
#define PP_CSUM_3(a1,a2,a3) (3*a1+2*a2+1*a3)
#define PP_CSUM_4(a1,a2,a3,a4) (4*a1+3*a2+2*a3+1*a4)
